import React from "react";
import { useState } from "react";
import { useEffect } from "react";

const BeerList = () => {
  const [beers, setBeers] = useState();

  useEffect(() => {
    setBeers(
      fetch("$ curl https://api.punkapi.com/v2/beers/1")
        .then((responseData) => {
          this.setState({ beers: responseData });
        })
        .catch((error) => {
